import styled from 'styled-components';

const WelcomeText = styled.text`
  font-size: 1.5em;
  text-align: center;
  text-transform: uppercase;
  letter-spacing: .08em;
  color: white;
  font-family: SpaceMonoRegular;
  font-weight: 100;
  opacity: 40%;
`

const TitleText = styled.text`
  font-size: 10em;
  text-align: center;
  color: white;
  text-transform: uppercase;
  font-family: SpaceMonoRegular;
  font-weight: 600;
  opacity: 85%;
`

const SubTitleText = styled.text`
  font-size: 0.5em;
  text-align: center;
  color: white;
  font-family: SpaceMonoRegular;
  font-weight: 50;
  opacity: 100%;
`

const FlexWrapper = styled.div`
  width: 100%;
  padding-bottom: 0;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: 5%;
`

export default function Title() {
  return (
    <FlexWrapper>
      <WelcomeText>welcome to the world of</WelcomeText>
      <TitleText>/panacea.</TitleText>

    </FlexWrapper>
  );
}
